import React from 'react';
import './Login.css'
import bG from '../../img/soziali.jpg';
import foroUser from '../../img/foroUser.jpg';
import userLogin from '../../img/Saly-13.png';

const LoginNew = () => {
    return (
        <div className='background'>
            <img src={bG} />
            <div className='contain'>
                <div className='contain2'>
                    <div className='minicontain'>
                        <img src={userLogin} />
                    </div>
                    <div>
                        
                        <form>
                        
                        </form>
                    </div>
                    <div className='pic'>
                        {/* <img  src={bG} /> */}
                    </div>
                </div>

            </div>
        </div>
    );
};

export default LoginNew;
